// import { toast } from "react-toastify";
import Button from "react-bootstrap/Button";
import Modal from "react-bootstrap/Modal";
import { deleteXuatXu } from "../services/xuatXuSevice";
import { toast } from "react-toastify";

const ModelConfirm = (props) => {
  const { show, handleClose, isDataXuatXu } = props;

  const confirmDelte = async () => {
    toast.success(
      "This data have Ma: " + isDataXuatXu.maXxx + " has been deleted"
    );
    let res = await deleteXuatXu(isDataXuatXu.idxx);
    console.log("Check res deleteXuatXu: " + res);
    handleClose();
  };
  return (
    <>
      <Modal
        show={show}
        onHide={handleClose}
        backdrop="static"
        keyboard={false}
      >
        <Modal.Header closeButton>
          <Modal.Title>DELETE</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <div>Are you sure want delete this data?</div>
          <br />
          <b>Ma: {isDataXuatXu.maXx}</b>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Close
          </Button>
          <Button variant="primary" onClick={() => confirmDelte()}>
            Confirm Delete
          </Button>
        </Modal.Footer>
      </Modal>
    </>
  );
};
export default ModelConfirm;
